import { Link } from "react-router-dom"
const SideNavigation= ()=>{
    return(
        <nav>
            <Link to='/addtask'>ADD TASK</Link>
            <Link to='/self'>TASK</Link>
            <Link to='/to'>To Other</Link>
            <Link to='/by'>By Other</Link>
        </nav>
    )
}

export default SideNavigation
